   353→
   354→        <p><b>Ghost vocabulary</b> refers to words and phrases that remain in active circulation within a language despite having undergone complete <a href="lexical-half-life.html">definitional decay</a>—their original meanings having eroded entirely, leaving only phonetic and orthographic forms that persist as "semantic shells." Unlike <a href="/wiki/Archaic_word">archaic words</a> that fall out of use as their meanings fade, ghost vocabulary continues to be spoken and written, appearing in conversations, official documents, and literature, even as speakers can no longer articulate what these words actually denote.<sup><a href="#cite1">[1]</a></sup></p>
   355→
   356→        <p>The concept was formally introduced by Norwegian computational linguist Dr. Ingrid Solheim in 2023 as an extension of her work on <a href="lexical-half-life.html">lexical half-life</a>. Solheim observed that certain words, upon reaching the theoretical endpoint of complete definitional decay, did not disappear from usage but instead entered a "phantom state" in which they continued to function syntactically while carrying no recoverable semantic content.<sup><a href="#cite2">[2]</a></sup></p>
