   378→
   379→        <h2 id="Discovery">Discovery and characterization<span class="mw-editsection">[<a href="/wiki/Ghost_Vocabulary?action=edit&section=1">edit</a>]</span></h2>
   380→        <p>The phenomenon of ghost vocabulary emerged from anomalies in the Oslo Lexical Decay Observatory's longitudinal studies. Researchers tracking the half-lives of English words expected that terms undergoing complete definitional decay would eventually exit the active lexicon—speakers would cease using words they could no longer define. Instead, data from the 2022-2023 observation period revealed a subset of words that continued appearing in corpora at stable or even increasing frequencies despite exhibiting near-zero definitional mass in controlled elicitation studies.<sup><a href="#cite3">[3]</a></sup></p>
   381→
   382→        <p>Initial analysis suggested measurement error, but Solheim's team developed protocols to distinguish ghost vocabulary from ordinary low-salience terms. The key finding was that subjects using ghost vocabulary displayed distinct patterns:</p>
   383→
   384→        <ul>
   385→            <li>They could not provide definitions when asked directly</li>
   386→            <li>They could not identify correct usage in multiple-choice contexts</li>
   387→            <li>They nevertheless used the terms confidently in conversation</li>
   388→            <li>They reported subjective certainty that they understood the words</li>
   389→            <li>When pressed, they often produced circular or self-referential pseudo-definitions<sup><a href="#cite4">[4]</a></sup></li>
   390→        </ul>
   391→
   392→        <blockquote>
   393→            "We asked participants to define words they had just used in natural speech. For most vocabulary, people can approximate a definition, even if imperfectly. With ghost vocabulary, we saw something unprecedented: total definitional absence coupled with undiminished usage confidence. They knew these words, except they didn't. The words were there, but empty."<br>
   394→            — Dr. Ingrid Solheim, 2023
   395→        </blockquote>
   396→
   397→        <h2 id="Theory">Theoretical framework<span class="mw-editsection">[<a href="/wiki/Ghost_Vocabulary?action=edit&section=2">edit</a>]</span></h2>
   398→
   399→        <h3 id="Hollowing">Semantic hollowing process</h3>
   400→        <p>Solheim proposes that ghost vocabulary results from a process she terms <b>semantic hollowing</b>. Unlike standard <a href="lexical-half-life.html">lexical decay</a>, where meaning components gradually detach and disperse, semantic hollowing involves the erosion of meaning from the inside out, leaving the external "shell" of the word intact while its definitional core becomes vacuous.<sup><a href="#cite5">[5]</a></sup></p>
   401→
   402→        <p>The process typically follows several stages:</p>
   403→
   404→        <ol>
   405→            <li><b>Core instability:</b> The central, prototypical meaning begins to lose coherence while peripheral associations remain</li>
   406→            <li><b>Associative compensation:</b> Speakers rely increasingly on contextual associations rather than denotation</li>
   407→            <li><b>Definitional scatter:</b> Asked to define the term, speakers produce wildly divergent responses</li>
   408→            <li><b>Collapse:</b> Even peripheral meanings decay, but the word persists through pure syntactic habit</li>
   409→            <li><b>Ghost state:</b> The term achieves stable meaninglessness, continuing in use as a formal placeholder<sup><a href="#cite6">[6]</a></sup></li>
   410→        </ol>
   411→
   412→        <h3 id="Persistence">Functional persistence</h3>
   413→        <p>The persistence of ghost vocabulary despite absent meaning poses a theoretical puzzle. Solheim's explanation invokes the concept of <b>syntactic fossilization</b>: words become so deeply embedded in common phrases, collocations, and grammatical constructions that they cannot be removed without rendering entire expressions ungrammatical. The word no longer carries meaning but serves as a structural keystone.<sup><a href="#cite7">[7]</a></sup></p>
   414→
   415→        <p>Additionally, Solheim identifies <b>social mimicry</b> as a persistence mechanism. Speakers continue using terms they observe others using, assuming that the apparent meaningfulness reflects their own incomplete understanding rather than genuine semantic emptiness. This creates a collective confidence game where everyone uses words no one understands, each assuming others grasp meanings they themselves cannot articulate.<sup><a href="#cite8">[8]</a></sup></p>
   416→
   417→        <h2 id="Identification">Identification criteria<span class="mw-editsection">[<a href="/wiki/Ghost_Vocabulary?action=edit&section=3">edit</a>]</span></h2>
   418→        <p>The Oslo Lexical Decay Observatory has established formal criteria for classifying a term as ghost vocabulary. A word must satisfy all of the following conditions:</p>
   419→
   420→        <table class="wikitable">
   421→            <tr>
   422→                <th>Criterion</th>
   423→                <th>Threshold</th>
   424→                <th>Measurement method</th>
   425→            </tr>
   426→            <tr>
   427→                <td><b>Definitional Integrity Index</b></td>
   428→                <td>&lt; 5% of baseline</td>
   429→                <td>Standardized elicitation across minimum 200 subjects</td>
   430→            </tr>
   431→            <tr>
   432→                <td><b>Usage frequency</b></td>
   433→                <td>&gt; 50% of pre-decay baseline</td>
   434→                <td>Corpus analysis of contemporary texts</td>
   435→            </tr>
   436→            <tr>
   437→                <td><b>Subjective comprehension rating</b></td>
   438→                <td>&gt; 70% confidence</td>
   439→                <td>Self-report measures during usage studies</td>
   440→            </tr>
   441→            <tr>
   442→                <td><b>Cross-population consistency</b></td>
   443→                <td>&lt; 15% definition overlap</td>
   444→                <td>Comparison of definitions across isolated populations</td>
   445→            </tr>
   446→            <tr>
   447→                <td><b>Temporal stability</b></td>
   448→                <td>&gt; 2 years in ghost state</td>
   449→                <td>Longitudinal tracking<sup><a href="#cite9">[9]</a></sup></td>
   450→            </tr>
   451→        </table>
   452→
