   494→
   495→        <p>Several other terms are currently under observation for potential ghost vocabulary classification, including "disrupt," "leverage" (verb form), "curate," and "unpack" (metaphorical sense).<sup><a href="#cite11">[11]</a></sup></p>
   496→
   497→        <h2 id="Categories">Categories of ghost vocabulary<span class="mw-editsection">[<a href="/wiki/Ghost_Vocabulary?action=edit&section=5">edit</a>]</span></h2>
   498→        <p>Research has identified several distinct categories of ghost vocabulary based on their origin and function:</p>
   499→
   500→        <ul>
   501→            <li><b>Corporate ghosts:</b> Business jargon that proliferated through overuse until meaning collapsed (e.g., "synergy," "leverage," "pivot")</li>
   502→            <li><b>Academic ghosts:</b> Scholarly terminology that spread beyond specialist contexts, losing precision with each transfer (e.g., "paradigm," "deconstruct," "problematic")</li>
   503→            <li><b>Therapeutic ghosts:</b> Psychology and self-help vocabulary that diffused into general usage (e.g., "trauma," "boundaries," "toxic")</li>
   504→            <li><b>Technological ghosts:</b> Digital-age terms whose referents evolved faster than their definitions could stabilize (e.g., "algorithm," "viral," "platform")</li>
   505→            <li><b>Political ghosts:</b> Ideological terminology whose meaning became contested to the point of incoherence (e.g., "freedom," "democracy" in certain contexts)<sup><a href="#cite12">[12]</a></sup></li>
   506→        </ul>
   507→
   508→        <p>A particularly notable subcategory is <b>recursive ghosts</b>—words whose definitions rely on other ghost vocabulary, creating chains of mutual meaninglessness. The phrase "authentic engagement," for instance, compounds two ghost terms, producing what Solheim calls a "double void."<sup><a href="#cite13">[13]</a></sup></p>
   509→
   510→        <h2 id="Effects">Cognitive and social effects<span class="mw-editsection">[<a href="/wiki/Ghost_Vocabulary?action=edit&section=6">edit</a>]</span></h2>
   511→        <p>The presence of ghost vocabulary in a language has documented cognitive and social consequences:</p>
   512→
   513→        <ul>
   514→            <li><b>Illusory communication:</b> Speakers believe they are conveying meaning when using ghost vocabulary, while listeners believe they are receiving it, though no actual semantic content transfers</li>
   515→            <li><b>Definitional anxiety:</b> When confronted with their inability to define commonly used terms, subjects frequently report distress and self-doubt</li>
   516→            <li><b>Expertise simulation:</b> Ghost vocabulary allows speakers to perform expertise in domains they do not understand, as neither speaker nor listener can verify actual comprehension</li>
   517→            <li><b>Document inflation:</b> Official and bureaucratic texts become padded with ghost vocabulary, increasing apparent complexity while reducing actual information content<sup><a href="#cite14">[14]</a></sup></li>
   518→        </ul>
   519→
   520→        <p>Some researchers have proposed connections between ghost vocabulary proliferation and broader phenomena such as <a href="temporal-debt.html">temporal debt</a> accumulation. The hypothesis suggests that using words without meanings generates a form of "semantic debt" that contributes to collective temporal incoherence, though this remains speculative.<sup><a href="#cite15">[15]</a></sup></p>
   521→
   522→        <h2 id="Detection">Detection methods<span class="mw-editsection">[<a href="/wiki/Ghost_Vocabulary?action=edit&section=7">edit</a>]</span></h2>
   523→        <p>Several methods have been developed for detecting ghost vocabulary in texts and speech:</p>
   524→
   525→        <ul>
   526→            <li><b>Definition elicitation:</b> Asking subjects to define terms immediately after using them; ghost vocabulary produces characteristic patterns of hesitation, circularity, and confabulation</li>
   527→            <li><b>Substitution testing:</b> Replacing suspected ghost terms with nonsense words; if communication proceeds normally, the original term was likely a ghost</li>
   528→            <li><b>Cross-examination:</b> Having multiple speakers define the same term independently; definition divergence beyond threshold indicates potential ghost status</li>
   529→            <li><b>Contextual necessity analysis:</b> Removing suspected ghost terms from sentences; if grammaticality persists and meaning is unaffected, the term may be semantically empty</li>
   530→            <li><b>Large language model probing:</b> AI systems trained on contemporary corpora exhibit characteristic instabilities when processing ghost vocabulary, producing inconsistent outputs that mirror human definitional confusion<sup><a href="#cite16">[16]</a></sup></li>
   531→        </ul>
   532→
   533→        <p>The development of automated ghost vocabulary detection has implications for <a href="semantic-hygiene.html">semantic hygiene</a> initiatives aimed at restoring meaning to public discourse.<sup><a href="#cite17">[17]</a></sup></p>
   534→
   535→        <h2 id="Controversy">Controversy<span class="mw-editsection">[<a href="/wiki/Ghost_Vocabulary?action=edit&section=8">edit</a>]</span></h2>
   536→        <p>The concept of ghost vocabulary has attracted criticism from several quarters:</p>
   537→
   538→        <ul>
   539→            <li>Linguists in the pragmatic tradition argue that "meaning" in natural language is always context-dependent and negotiated; what Solheim calls ghost vocabulary may simply be terms with unusually high context-sensitivity</li>
   540→            <li>Critics note that the boundary between polysemy (multiple related meanings) and meaninglessness may be arbitrary; a word with many meanings might appear to have no single meaning without being truly empty</li>
   541→            <li>Some researchers suggest that ghost vocabulary represents not absent meaning but distributed meaning—semantic content that exists across speaker networks rather than in individual minds</li>
   542→            <li>Practical objections note that the classification criteria are extremely stringent, possibly identifying only extreme cases while missing the more common phenomenon of partial semantic erosion<sup><a href="#cite18">[18]</a></sup></li>
   543→        </ul>
   544→
   545→        <p>Solheim has responded that the existence of borderline cases does not invalidate the category: "The fact that dusk exists does not disprove the difference between day and night. Ghost vocabulary occupies the midnight of meaning—not merely dim, but definitionally dark."<sup><a href="#cite19">[19]</a></sup></p>
